import Login from './auth/Login'
import Main from './main/Main'
import { BrowserRouter, Route } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <div>
        <Route exact path='/' component={Login} />
        <Route exact path='/menu' component={Main} />
      </div>
    </BrowserRouter>
  );
}

export default App;
